import React from "react";
import Head from "next/head";
import AppLayout from "../components/AppLayout";

const signup = () => {
  return (
    <>
      <Head>
        <title>SignUp Page | NodeBird</title>
      </Head>
      <AppLayout>
        <div>Signup Page</div>
      </AppLayout>
    </>
  );
};

export default signup;
